export class ComplicationCoeur{
    PatientId: number;
    ArretCardiaque: boolean;
    Echocardiographie:boolean;
    DateEchocardiographie:string;
    SignesCardiomypathy:boolean;
    FractionEjectionSystoliqueGauche:number;
    SignesHtap:boolean;
    AutresAnomaliesEchographiques:boolean;
    Préciser:string;
    Electrocardiogram:boolean;
    ElectrocardiogramAbnormal:boolean;
    ExplorationsCardiaquesAutre:boolean
    PreciserAutre:string;
    Irmcardiaque:boolean;

    constructor(){
        this.PatientId=0;
        this.ArretCardiaque=false;
        this.Echocardiographie=false;
        this.DateEchocardiographie='';
        this.SignesCardiomypathy=false;
        this.FractionEjectionSystoliqueGauche=0;
        this.SignesHtap=false;
        this.AutresAnomaliesEchographiques=false;
        this.Préciser='';
        this.Electrocardiogram=false;
        this.ElectrocardiogramAbnormal=false;
        this.ExplorationsCardiaquesAutre=false;
        this.PreciserAutre='';
        this.Irmcardiaque=false;
        
    }
}
